import React from "react";
import RetweetOutlined from '@ant-design';

const PostCard=()=>{
    return(
<div>
    <Card
        cover={post.Images[0] && <PostImages images={post.Images}/>}
        actions={[
            <RetweetOutlined />
        ]}
    >
        <Image/>
        <Content/>
        <Buttons></Buttons>
    </Card>
    <CommentForm/>
    <Comments/>
</div>
    )

}


export default PostCard;
